  <div className="customer-dashboard-card">
    <h2 className="customer-dashboard-title">My Account</h2>
    <div className="customer-dashboard-info">
      <div>
        <span className="info-label">Name:</span> Demo User
      </div>
      <div>
        <span className="info-label">Email:</span> demo@user.com
      </div>
      <div>
        <span className="info-label">Balance:</span> 150.00 SEK
      </div>
    </div>
  </div>
);

export default Dashboard;


import auth from "../modules/auth";
